import React from 'react';
import { Link } from 'react-router-dom'

const Home = () => {
    return ( 
        <div>
            <p><b>What would you like to do?</b></p>
            <div className='box'>
                <Link to='/random' style={{color: 'grey'}}><b>Practice with random verbs</b></Link>
                <p>Translate randoms verbs, tenses, and forms</p>
            </div>
            <div className='box'>
                <Link to='/option' style={{color: 'grey'}}><b>Choose the verbs you want</b></Link>
                <p>Select your verbs, tenses, and forms</p>
            </div>
        </div>
     );
}

export default Home;
